script: |
  super -f text -I q834.spq | sort > q834.out

inputs:
  - name: q834.spq
    data: |
      SELECT DISTINCT + - col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 IN ( + col1 / - col2 / - + col2 * col0, - col1, - col2, + + col0 );
  - name: tab0

outputs:
  - name: q834.out
    data: |
      -1
      -21
      -81
